import React from "react";

class ContactPage extends React.Component {
  constructor(props) {
    super(props);
    this.statr = {
      name: "",
      email: "",
      message: "",
      disabled: false,
      emailSent: null,
    };
  }

  render() {
    return <p>ContactPage Works!</p>;
  }
}

export default ContactPage;
